INSERT INTO `content` VALUES (1, NULL, '<article><p>虎鲸，是鲸偶蹄目海豚科虎鲸属\n[19]&nbsp;\n哺乳动物\n[20]&nbsp;\n。成体体重6600千克，平均体长6-9米；头部略圆，具有不明显的喙或无喙；身体黑、白两色；眼的后上方具椭圆形的白色眼斑；上颌和下颌每侧都有10-12枚圆锥形的齿；雄性体长大于雌性，体重约为雌性成体的一倍\n[19]&nbsp;\n。虎鲸头大，黑白色相间，视若虎，故名\n[21]&nbsp;\n。虎鲸分布于中国辽宁、山东、浙江、台湾附近海域，在全球各大洋也有分布，高纬度地区和近岸海域常见。\n[19]&nbsp;\n虎鲸是大洋性种类，没有固定栖息场所，主要追逐其所嗜食的鱼类或其他海兽移动\n[22]&nbsp;\n，通常聚集成5-20头的群，也有达到100头或更多的群。\n[19]&nbsp;\n虎鲸除食大型鱼类外，常成群追食海豹、海狗、海象、海豚等海兽，甚至袭击大型的须鲸类\n[23]&nbsp;\n。雌性虎鲸每5年产1仔，终生可产5仔。雄性寿命50-60年，雌性寿命80-90年。\n[19]&nbsp;\n虎鲸是一种高度社会化的动物，会组成家族，而且是动物世界里最稳定的家族，有较为复杂的社会行为、捕猎技巧和声音交流等。\n[24]&nbsp;\n海洋中，虎鲸是“海上杀手”，小到鱼类、乌贼、海龟，大到海狮、海豹甚至须鲸和抹香鲸，都难逃虎鲸的捕杀，因此，虎鲸也有着“杀手鲸”的称号。\n[25]&nbsp;\n海洋环境的污染以及大量捕捉虎鲸活体用于水族贸易，虎鲸的生存受到严重威胁\n[26]&nbsp;\n，现已被列为中国二级保护野生动物。\n[19]<img src=\"https://bkimg.cdn.bcebos.com/pic/0824ab18972bd40710d94ba874899e510fb3094c?x-bce-process=image/resize,m_lfit,w_536,limit_1/format,f_auto\" alt=\"虎鲸\" style=\"font-size: 14px;\"/><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/></article>');
INSERT INTO `content` VALUES (2, NULL, '<p>虎鲸是虎鲸属中仅有公认的物种，也是林奈于1758年在《自然系统》中最初描述的许多动物物种之一。因其头大，黑白色相间，视若虎，故名。康拉德·格斯纳（Konrad Gessner）在对格赖夫斯瓦尔德湾（Bay of Greifswald）的一头搁浅而死的动物进行了检查后，在他于1558年撰写的《鱼和水生动物的世界 》（Piscium&amp;aquatilium animantium natura）（较大的历史动物区系）中首次对虎鲸进行了科学描述，引起了当地极大的关注。\n[3-4]&nbsp;&nbsp;\n[21]&nbsp;\n虎鲸是大约一百万年前首次出现的海洋海豚科中的35个物种之一。此后不久，虎鲸血统就有分支。理查德·勒杜克（Richard LeDuc）对细胞色素b基因序列的研究表明，尽管它与伪虎鲸、小虎鲸和领航鲸在形态上相似，但它最接近的近亲是伊豚属的澳大利亚短平鼻海豚。然而，2018年的一项研究将虎鲸作为海豚亚科的姊妹类群，其中包括斑纹海豚属和矮海豚属。\n[5-6]&nbsp;&nbsp;尽管“逆戟鲸”一词的使用越来越多，但说英语的科学家最常使用的还是传统名称“虎鲸”。虎鲸属“Orcinus”学名的意思是“死者之国”。古罗马人最初将逆戟鲸（pl.orcae）用于这些动物，可能借用了古希腊语ὄρυξ（óryx），该词除其他外还指鲸种。自1960年代以来，“逆戟鲸”一直在稳步增长。一些人更喜欢“逆戟鲸”一词，因为它避免了“杀手”（killer）的消极含义，并且因为作为海豚科的一部分，该物种与其他海洋海豚的关系比与其他鲸鱼的关系更为密切。\n[7]&nbsp;\n它们有时被称为“黑鲸”（blackfish），也用于其他鲸鱼种类。“灰海豚” （Grampus）是该物种的前称，但已经很少使用。 “ grampus”的含义不应与灰海豚属（Grampus）混淆，后者的唯一成员称灰海豚。\n[8]&nbsp;\n即使有越来越多的证据表明该分类单位实际上是一个单一物种，实际上它是具有形态、遗传、生态和行为差异的多种形式的复合体，即使不是物种名称，也应具有亚种的价值。在撰写本文时（2017年6月），海洋哺乳动物学会分类学委员会（The Marine Mammalogy\'s Taxonomy Committee）被认为是海洋哺乳动物分类法的权威，认可了单一的虎鲸物种”Orcinus orca“（Linnaeus，1758年）和北太平洋东部的两个未命名的亚种，即东太平洋居留鲸（O. o.un-named subsp.）。 东太平洋过客鲸（O. o.un-named subsp.）也被称为“大虎鲸”（Bigg’s killer whal）。然而，海洋哺乳动物学会注意到：“北太平洋、北大西洋和南极南部海洋中的其他形式的虎鲸可能需要确认为单独的亚种甚至物种，但分类法尚未得到充分阐明或同意。根据2003年的《加拿大濒危物种法》，北太平洋东部原产地亚种中的一个种群“南方种群”（the “southern resident” population ）被列为美国2005年的《濒危物种法》中的“濒危物种”。\n[2]&nbsp;\n截止到2017年已定义和认可的分类单元是虎鲸（《海洋哺乳动物学会》2017年），不符合IUCN红色名录中受威胁地位的任何标准。虎鲸在数量上非常丰富（至少成千上万的成熟个体）并且分布非常广泛。专家们一致认为，分类单元可能包括一个以上的亚种，并且可能包括多个物种。已知一些小区域人口已经大幅下降，如果单独评估，将很容易获得受威胁的地位（例如，ENP的物种，与直布罗陀海峡有关的依赖蓝鳍金枪鱼的虎鲸数量），但没有足够的证据支持全球虎鲸物种丰富度的下降，使其符合标准A。但是，先前的物种评估（Taylor等人，2013年）中的声明仍然成立：“由猎物资源枯竭和污染物的影响驱动的潜在下降的组合，人们认为，对于某些可能最终被指定为虎鲸物种的“群体”，不能排除在三代中全球减少30%的可能性。”\n[2]&nbsp;\n尽管人们仍在继续努力以更好地了解虎鲸属的分类学，但是分类学问题尚未完全解决。由于在北太平洋东部，南极和其他地方可能出现同生，非交配生态型，这尤其成问题。由于分类学的不确定性，该分类单元先前被IUCN列为“数据不足”，并且应该继续列出，直到描述了适当的分类单元并可以对其进行红色名录列表评估。\n[2]&nbsp;\n（注：ENP 北太平洋东部。“eastern North Pacific”）<br/></p>');
