INSERT INTO `content` VALUES (27, NULL, '<p>主要分布于西太平洋热带沿海，澳大利亚和印度亦产。中国境内无分布。<sup>&nbsp;[2]</sup><a>&nbsp;</a></p><p>于缪汝槐(1981)曾报道中国海南岛发现澳洲波喜荡(Posidonia australis)，文中所提标本(标本号121490，于1960年7月26日采集于海南岛，存放于中山大学植物标本馆)，经澳大利亚的GaryKendrick教授重新鉴定后确认为海菖蒲(Enhalusacoroides)，并非澳洲波喜荡。因后者仅分布于澳大利亚南部海域，生长区域比较狭窄，属典型的温带海草(Short et al., 2007)，且在近年来的调查中亦未在我国发现该种，因此将澳洲波喜荡从我国海草原名单(范航清等, 2009)中剔除。此外, Flora of China(Flora of China Editorial Committee, 2010)里记录的澳洲波喜荡生境为“浅海海底低潮线上”，亦与其实际生境不符，澳洲波喜荡生长于低潮线下至水深12 m，水质较清时可至22 m水深处(Short et al.,2012)。</p><p><br/></p><p>&nbsp; &nbsp;&nbsp;<img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/>');
INSERT INTO `content` VALUES (28, NULL, '<p>虎鲸，是鲸偶蹄目海豚科虎鲸属哺乳动物。也是海豚科中体型最大的一种。成年雄性平均长度为8米，最大记录是9.75米，雌性体重3.8吨，雄性体重5.5吨。雌性平均长度为7米，最大长度为8.5米。身体大小、鳍肢大小和背鳍高度有明显的性二型。雌性的平均体重和体重略小于雄性。雌性最大体长达7.70 米，雄性体长达9米。1头体长6.70米的雌性重3.8吨，而1头体长6.75米的雄性重5.5吨。雄性成体的背鳍直立，高可达1.0-1.8米，雌性的背鳍明显地镰刀形，高不及0.7米。该鳍弯曲到右侧或左侧。\n[9-10]&nbsp;&nbsp;\n[17]&nbsp;\n\n[19-20]&nbsp;&nbsp;\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n虎鲸\n\n\n虎鲸成体头骨的髁基长可达1000毫米。在眶前凹前方过两前颌骨的宽小于吻突宽。两翼骨远隔开。颞窝大。下颌骨相对较短。具有不明显的喙。椭圆形的鳍肢位于体全长的前1/4处。雄性的鳍肢长可达体全长的20%，雌性的达11%-13%。尾叶宽可超过体全长的1/5。\n[9]&nbsp;\n虎鲸体形呈纺锤形，表面光滑，皮肤下面有一层很厚的脂肪用来保存身体的热量。身体上的颜色黑白分明，背部为漆黑色，在鳍的后面有一个马鞍形的灰白色斑，两眼的后面各有一块梭形的白斑，腹面大部分为雪白的颜色。下颌及从下颌前端到尿殖区的体腹面白色。有1个白色的叶状斑从尿殖区向上伸到背鳍后的体侧。尾叶的腹面白色或浅灰色，可能具黑色边缘。在每侧眼的后上方具椭圆形的白色眼斑。鞍斑在年幼时不明显，性成熟后更显著。<img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><p>&nbsp;[19]&nbsp;\n虎鲸头部略圆，具有不明显的喙或无喙；没有突出的吻部，鼻孔在头顶的右侧，有开关自如的活瓣，当浮到水面上时，就打开活瓣呼吸，喷出一片泡沫状的气雾，遇到海面上的冷空气就变成了一根水柱。前肢变为一对鳍，很发达，后肢退化消失。高耸于背部中央的强大的三角形背鳍，十分显眼，既是进攻的武器，又可以起到舵的作用。嘴很大，上颌和下颌每侧都有10-12枚圆锥形的齿，其横切面呈椭圆形，齿尖向内和向后。在一些较老的个体，齿常被磨蚀或溃烂损坏。椎式：C7，T11-13，L10-12，Ca20-24=50-54。\n[18-19]</p>');
INSERT INTO `content` VALUES (29, NULL, '<p>&nbsp; &nbsp; &nbsp; 东海主要出现于水深大于200m的陆架外，其垂直分布在50m上层；南海有时出现在l000m水深，但主要栖息在100m上层。一年四季出现于南海北部陆架内外区以及中沙、西沙群岛周围海区，数量较多，为西沙群岛海域管水母类优势种之一。属大洋广布科。本种在百慕大海域垂直分布局限于50m上层；在加那利群岛水深40m或50m拖网采到的样品，有半以上是这种水母<br/></p><p><br/></p><p><img src=\"data:image/png;base64,\" alt=\"data:image/png;base64,\" contenteditable=\"false\" style=\"font-size: 14px; max-width: 100%;\"/></p><br/>');
