INSERT INTO `ebook` VALUES (24, 'DK 生物大揭秘：海洋生物', 1, NULL, NULL, '潜入深深的海洋中，展开一次不可思议的海洋之旅吧！ 和一群剧毒的水母一起随波逐流，探索梦幻般迷人的珊瑚礁，与张开血盆大口的大白鲨面对面，去幽深、漆黑的深海海底一探究竟……', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/bf78dea681b04b60bd284da86b577f15.jpg', NULL, 10, NULL);
INSERT INTO `ebook` VALUES (25, '海底两万里', 1, NULL, NULL, '此书主要讲述鹦鹉螺号潜艇的故事。1866年，海上发现了一只疑似为独角鲸的大怪物，阿龙纳斯教授及仆人康塞尔受邀参加追捕。在追捕过程中，他们与鱼叉手尼德·兰不幸落水，到了怪物的脊背上。他们发现这怪物并非是什么独角鲸，而是一艘构造奇妙的潜艇。潜艇是尼摩在大洋中的一座荒岛上秘密建造的，船身坚固，利用海水发电。尼摩船长邀请阿龙纳斯海底旅行...', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/3a3b009fcd124fa6a268978780b34270.jpg', NULL, 3, NULL);
INSERT INTO `ebook` VALUES (26, '海洋动物图鉴', 1, NULL, NULL, '以艺术化笔触还原海洋生物形态，标注拉丁文与英文名称，涵盖甲壳类、贝类、棘皮类等 9 大类，兼具科学性与收藏价值...', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/03351ada0fd54f758466e25d4a839987.jpg', NULL, 1, NULL);
INSERT INTO `ebook` VALUES (27, '深海浅说', 5, NULL, NULL, '系统梳理深海研究的最新成果，涵盖深海地质、碳循环、生物多样性及 “蛟龙号” 深潜等前沿领域，解答深海探测技术挑战与生态保护议题。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/3309e8bb43b14006806655bfe36e9f3b.jpg', NULL, NULL, NULL);
INSERT INTO `ebook` VALUES (28, '水母之书', 4, NULL, NULL, '以 50 种水母为例，讲述其 5 亿年生存史、繁殖策略及对海洋生态的影响，配以高清摄影与手绘插图。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/392f91c3b5ac47bcb0571d7a1dcc1f6d.jpg', NULL, NULL, NULL);
INSERT INTO `ebook` VALUES (29, '我们身边的海洋', 3, NULL, NULL, '从人类探索海洋的历史切入，讲述洋流、潮汐、岛屿形成等自然现象，揭示海洋与生命演化的关系。书中融合科学观察与诗意描写，被誉为 “海洋生态学的奠基之作”。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/150d4bbaea5e42fd95a0958206177292.jpg', NULL, 2, NULL);
INSERT INTO `ebook` VALUES (30, '鱼的好奇心', 4, NULL, NULL, '颠覆对鱼类的刻板认知，讲述鲱鱼 “放屁交流”、清洁鱼 “客户管理” 等趣味行为，结合最新研究揭示鱼类的智力与情感。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/b6cf7c1b7aae495c90480709e8040453.jpg', NULL, 4, NULL);
INSERT INTO `ebook` VALUES (31, '章鱼的心灵', 4, NULL, NULL, '探讨头足类动物的演化历程与独特神经系统，解析章鱼的高智力行为及短暂生命背后的哲学思考。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/b5999f56bbbc4fb4996e097859f37c74.jpg', NULL, 3, NULL);
INSERT INTO `ebook` VALUES (32, '中国常见海洋生物原色图典', 3, NULL, NULL, '分 6 册系统收录中国海域常见生物，包括腔肠动物、棘皮动物、软体动物等，每种生物配原色图片与分类学解析。', 'https://oceandemo.oss-cn-guangzhou.aliyuncs.com/bookCover/58dc420f9efe4f6ebe99677c87ad2333.jpg', NULL, 1, NULL);
